import React, { Component } from 'react';

class User extends Component {
  render() {
    return (
        <div className="col-md-4 p-2">
        <div className="card" style={{width : "18rem"}} key={this.props.key}>
            <img src={this.props.avatar_url} className="card-img-top" alt="User Image" />
            <div className="card-body">
                <h5 className="card-title">{this.props.login}</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href={this.props.html_url} target="_blank" className="btn btn-primary">Go To Profile</a>
            </div>
        </div>
    </div>
    )
  }
}

export default User
